import React from "react";
import Nav from './Nav'
import login_img from './img/login_img.jpeg';
import './Nav.css';
import './Home.css';


const home ={
    backgroundImage: 'url(' + login_img + ')',
    width: '100%',
    height: '100%',
    backgroundRepeat: 'no-repeat',
    backgroundSize: '100% 100%',
}
class Home extends React.Component {
  constructor(props) {
    super(props);

  }
  render() {
    return (
      <div style={home}>
          <Nav/>
            <div class="image">
                <a class="btn" href="/login"><span>Register/Login</span></a>
            </div>
            <div id="about">

                    <div class="row">
                        <div class="about col-lg-6 col-md-6">
                            <div class="pic"></div>
                        </div>

                        <div class="content col-md-offset-6 col-lg-offset-6">
                          <center><h1 class="contentHead">ABOUT ME</h1></center>


                      </div>
                    </div>   

            </div>
            <div id="contact">    
            Building your own website with JavaScript is fulfilling and exciting. The slowest part for me was commencing the project and the focus of this post is to enable readers to understand one approach to getting started. From then, a developer can extend it with different styles and functionality in any way they choose.
            </div>

      </div>
    );
  }
}


export default Home
